import ReactDOM from 'react-dom';
import './index.css';
import{ App} from './App';
import {createServer} from 'miragejs'
createServer({
  routes(){
    this.namespace='api'
    this.get
  }
})



ReactDOM.render(
  <React.StrictMode>
    <App/>
  </React.StrictMode>,
  document.getElementById("root")
);
